import { ExpenseItem } from "../ExpenseItem/ExpenseItem"
import './ExpenseList.css';

export const ExpenseList = (props) => {
    const list = props.expenses

    return (
        <div className="expenses-list">
            {list.map(item => 
                <ExpenseItem className="expenses-list__fallback"
                key={item.id}
                date={item.date}
                title={item.title}
                amount={item.amount}
                />
            )}
        </div>
    )


}
